Text:
@shailesh417: I answered you on same request few days back: Currently, only RC (prerelease, Release Candidate) BluRay is out and I would wait normal release. Because I already done Mechanic from PAL DVD (tagged as R5) I don't see the point in making surplus. Small-sized "Mechanic" is available - everywhere.

Besides, it's against my rules:

"Do NOT bother requesting easily available titles. If I haven't encoded something new and current - I have my reasons for that."
